import { useNavigate } from "react-router-dom";
const Mainlr = () => {
	const navigate = useNavigate()
	const handleLogout = () => {
		localStorage.removeItem("token");
		window.location.reload();
		navigate("/Doctor-Stats")
	};

	return (
		<div>
			<nav>
				<h1>fakebook</h1>
				<button onClick={handleLogout}>
					Logout
				</button>
			</nav>
		</div>
	);
};

export default Mainlr;
